>',0,'1','0','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0cca','学籍管理','app/detail/201609/1475141395501.png','class/index','app/detail/201610/1476675269887.png,app/detail/201610/1476675269864.png,app/detail/201610/1476675269854.png,app/detail/201610/1476675269842.png,app/detail/201610/1476675269832.png,app/detail/201610/1476675269816.png,app/detail/201610/1476675269804.png',2,1,0,'1',1479190430102,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">学籍管理系统主要对学校学生信息的基础数据进行管理和维护，同时维护学校的部分基础信息，比如学校的学段设置、班级设置、其他基本设置等等。学籍管理系统作为学生基础数据的入口，为学生考勤、成绩分析等等系统提供了基础数据，实现了对整个平台的学生基础数据的统一管理，减少数据维护工作，减少沟通成本，提高了相应的教学教务的工作效率。</span></p>',0,'1','0','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0ccb','应用商店','app/detail/201609/1475142456413.png','app/appstore/index','app/detail/201610/1476683805438.png,app/detail/201610/1476683805416.png,app/detail/201610/1476683805407.png',3,0,0,'1',1479190601359,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">应用商店是一个开放的应用生态圈，可以利用全接口整合第三方应用，学校可以根据其个性化需求在应用商店中选择实际需要的应用，同时商店中的应用会持续更新，满足学校日后对应用的需求，促进学校的长远发展。</span></p>',0,'3,2,1','0','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0ccd','通知公告','app/detail/201609/1475142634153.png','notify/index','app/detail/201610/1476688169684.png,app/detail/201610/1476688169674.png,app/detail/201610/1476688169667.png,app/detail/201610/1476688169653.png',3,0,0,'1',1479190510494,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">通知公告主要面向教职工，对于校内的各类通知的发布，均可以通过通知公告应用来实现，并且对发布内容以及通告栏目有明确的管理人员和制度，对通知的发布做到严格控制。</span></p>',0,'1','0','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0cce','通讯录','app/detail/201609/1475139465580.png','contact/contact/index','app/detail/201609/1475139775314.png',3,0,0,'1',1479190409746,NULL,NULL,'<p class=\"MsoNormal\"><span style=\"font-family: 微软雅黑; color: #333333; letter-spacing: 0pt; font-size: 10.5pt;\">通讯录作为平台的基础功能，同步人事管理中的部门管理的教职工通讯信息，方便学校内部查询相关教职工信息，便于管理和使用。</span></p>',0,'1','0','教育云平台',1),('1fca23c8f69bbdb6bf7afc9de13a0ccf','人事管理','app/detail/201609/1475142163111.png','area/renyuan/index','',1,0,0,'1',1492135758103,NULL,NULL,'',0,'1','0','教育云平台',1),('209b707e05ce4f3096411b0baca790d2','活动中心','http://file3.ckmooc.com/%E6%B4%BB%E5%8A%A8%E4%B8%AD%E5%BF%83.png','http://118.190.66.188/cloud/index.php/event/index/index','http://file3.ckmooc.com/%E6%B4%BB%E5%8A%A8%E4%B8%AD%E5%BF%83.png',2,2,1,'邢丽',1502679173906,NULL,NULL,'<p>旨在促进学生活跃度的智能化软件，鼓励学生的奇思妙想，拓展课堂之外的知识面</p>',0,'1,2,3','2','sns',0),('4bbc22b9ba6e484aa7a73438b957171d','互动社区','http://file3.ckmooc.com/%E4%BA%92%E5%8A%A8%E7%A4%BE%E5%8C%BA.png','http://118.190.66.188/cloud/index.php/forum/index/index','http://file3.ckmooc.com/%E4%BA%92%E5%8A%A8%E7%A4%BE%E5%8C%BA.png',2,2,1,'邢丽',1502678884906,NULL,NULL,'<p>学生的生活家长以及老师可以在此交流，家长可以更好的了解自己的孩子在学校的状态，老师也可以根据学生状态给家长提出最好的建议</p>',0,'1,2,3','2','sns',0),('5499b97c06adf875c22c7c1e1f6cdf72','教务管理','app/detail/201609/1475142163699.png','teach/task/cycle/index','',2,1,0,'1',1492156911727,NULL,NULL,'',0,'4,3,2,1','0','教育云平台',1),('590abb7f87914875999a88652a960987','资讯广场','http://file3.ckmooc.com/%E8%B5%84%E8%AE%AF%E5%B9%BF%E5%9C%BA.png','http://118.190.66.188/cloud/index.php/news/index/index','http://file3.ckmooc.com/%E8%B5%84%E8%AE%AF%E5%B9%BF%E5%9C%BA.png',2,2,1,'邢丽',1502679309513,NULL,NULL,'<p>资讯共享，旨在传播社会大课堂的知识和促进学生从小树立关心国家大事，人人有责的责任感</p>',0,'1,2,3','1','sns',0),('8cd054787df64400b8e7cf00668b376f','阳光分班','http://file3.ckmooc.com/%E9%98%B3%E5%85%89%E5%88%86%E7%8F%AD.png','http://baidu.com','http://file3.ckmooc.com/%E9%98%B3%E5%85%89%E5%88%86%E7%8F%AD.png',2,2,1,'邢丽',1502678285882,NULL,NULL,'<p>阳光分班是一款根据学校总人数和学生信息进行自动化分班的智能化系统，旨在减轻工作人员失误与大量繁琐的工作</p>',0,'1,2,3','1','sns',0),('9df75783cd1648399b4aedbb6ccb7fab','慕课直播','http://file3.ckmooc.com/%E6%85%95%E8%AF%BE%E7%9B%B4%E6%92%AD.png','http://baidu.com','http://file3.ckmooc.com/%E6%85%95%E8%AF%BE%E7%9B%B4%E6%92%AD.png',2,2,1,'邢丽',1