insert  into `teach_class_card_notify`(`id`,`title`,`type`,`content`,`update_by`,`update_date`,`create_by`,`create_date`,`del_flag`) values ('00d588654a1bbbd16ba529a70bee7401','４５６',2,'人员同意让他有',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1500863094743,0),('04a857f0bd748a52c36608363095ee3d','６６',2,'６６６６６６６',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1500863058924,0),('09fd3a51a59aa43d6371cf29be5737fc','123123',1,'12123123',NULL,NULL,'690',1499250463422,0),('0a3755627a97a7e3795107b5eea8e631','开发与我们产品及服务的使用相关的统计信息，以更好地改进我们的',1,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>允许客户确定包裹中的物品。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您参与 MIUI 论坛。与 MIUI 论坛或其他小米网络平台有关的个人信息可能被用于个人资料页面展示、与其他用户互动、参与论坛。</span></p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供小米云和其他 MIUI 服务</span>。收集信息（设备或 SIM 卡相关信息，包括 IMEI 号码、IMSI 号码、电话号码、设备号、设备操作系统、MAC 地址、设备类别、系统和性能信息和诸如移动国家代码、移动网络代码、位置区域代码和小区标识等位置信息）用于激活 MIUI 服务，例如小米云、通话日志同步、短消息同步、查找设备，并用于用户认证和服务激活。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">诊断激活失败</span>：相关的地理位置信息用于评估 SIM 卡激活失败（例如短信服务 (SMS) 网关和网络失效），以识别该服务的网络运营商，并向网络运营商通知这一问题。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供其他 MIUI 服务</span>。为每项 MIUI 服务收集的其他信息可能会用于执行该服务的功能，为了用户利益帮助提供该项服务，例如下载、更新、注册、执行与 MIUI 服务相关的活动。例如，通过主题商店收集的个人信息可能会用于根据您的下载和浏览历史提供个性化主题推荐服务。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供其他 MIUI 服务</span>。为每项 MIUI 服务收集的其他信息可能会用于执行该服务的功能，为了用户利益帮助提供该项服务，例如下载、更新、注册、执行与 MIUI 服务相关的活动。例如，通过主题商店收集的个人信息可能会用于根据您的下载和浏览历史提供个性化主题推荐服务。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">记录照片的位置信息</span>。您能够在拍照时记录位置信息。这一信息在照片文件夹中可见，并且位置将保存在照片的标头中。如果您不希望在拍照时记录位置，您可以随时在设备相机设置中关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供信息传送功能（例如米聊、Mi Message）</span>。如果您下载和使用米聊，米聊收集的信息可能会用于激活这一服务，并识别用户和信息接收者。此外，聊天记录将被保存，便于在用户重新安装应用后重新加载历史聊天，或用于设备之间的同步。信息（发送者和接收者的电话号码和 Mi Message 账号）可用于 Mi Message 服务激活，让该服务发挥作用，包括消息的路由选择。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供基于位置的服务</span>。在使用 MIUI 服务时，我们或第三方服务供应商可能会使用位置信息以为您提供正确版本的服务，并且提供准确的位置，以获得尽可能好的用户体验，例如天气信息、位置接入（作为安卓平台的一部分）。您可以随时进入设备设置或停止使用这一应用程序来关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">改善用户体验</span>。某些选择性加入功能，例如用户体验计划，允许小米分析用户如何使用手机和 MIUI 服务的数据，以改善用户体验，例如发送崩溃报告。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您使用安全中心</span>。收集的信息可能会用于安全中心的安全和系统维护功能，例如广告拦截、病毒扫描、省电模式、黑名单、清理器等。其中有些功能是由第三方服务供应商运营的。信息（像病毒定义列表之类的非个人信息）将用于病毒扫描功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供推送服务</span>。小米账号和 IMEI 号码也将用于提供小米推送服务，以评估广告表现和从 MIUI 发送软件更新或新产品发布的通知，包括销售和促销信息。您可以随时通过更改“设置”项下的偏好选项来关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">验证用户身份</span>。小米使用 ECV 值来验证用户身份，确保黑客或未经授权的人员无法登陆。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">收集用户反馈</span>。您选择提供的反馈对帮助小米改进我们的服务而言极为珍贵。为了跟踪您选择提供的反馈，小米可能会使用您所提供的个人信息与您联系，并保留记录。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">发送通知</span>。我们可能会不时使用您的个人信息来发送重要通知，例如有关购买物的通信和我们的条款、条件和政策变更。</p></li></ul><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1506494355108,0),('0f2ed9e357a226f12c7f1ffbf59993fe','黄冈市中心城区全面禁止燃放烟花爆竹的规定',2,'<p><span style=\"font-size:18px\">第一条&nbsp;&nbsp;&nbsp; 为加强烟花爆竹安全管理，保障公共安全和减少环境污染，根据《烟花爆竹安全管理条例》（国务院令第455号）、《湖北省燃放烟花爆竹若干规定》（省政府令第289号）有关规定、借鉴外地经验，制定本规定。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第二条&nbsp;&nbsp;&nbsp; 黄冈中心城区下列区域内全年禁止燃放烟花爆竹：东起南湖路与世纪大道交汇处，沿世纪大道南端，南至沿江大道，西以沿江大道为界，西北至新港北路与沿江大道交汇处，北沿新港北路，至黄婆汉路与三台河交汇处，沿三台河西岸，东至三台河与南湖路交汇处的围合范围。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第三条&nbsp;&nbsp;&nbsp; 未列入禁止燃放烟花爆竹的区域，禁止在下列地点燃放烟花爆竹：<br/>&nbsp;&nbsp;&nbsp; （一）党政机关所在地；<br/>&nbsp;&nbsp;&nbsp; （二）文物保护单位；<br/>&nbsp;&nbsp;&nbsp; （三）车站、码头等交通枢纽以及铁路线路安全保护区及其他重点消防单位或区域；<br/>&nbsp;&nbsp;&nbsp; （四）重要军事设施和输变电设施安全保护区；<br/>&nbsp;&nbsp;&nbsp; （五）易燃易爆物品生产、储存单位、场所；<br/>&nbsp;&nbsp;&nbsp; （六）幼儿园、托儿所、医院、敬老院、疗养院、教学、科研、生产等场所；<br/>&nbsp;&nbsp;&nbsp; （七）山林等重点防火区；<br/>&nbsp;&nbsp;&nbsp; 黄州区人民政府、黄冈高新区管委会、市区有关职能部门，应当在上述地点设置警示标志，明确守护责任单位和责任人，制订应急预案，加强禁止燃放烟花爆竹的管理。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第四条&nbsp;&nbsp;&nbsp; 禁鞭区域内烟花爆竹的生产、储存、运输、销售、使用和处置，按照相关法律、法规、规章执行。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第五条&nbsp;&nbsp;&nbsp; 未列入禁止燃放烟花爆竹的区域，未经许可不得经营、运输烟花爆竹；销售、储存、燃放的烟花爆竹应当符合安全生产监督、公安、工商行政管理等部门规定的规格和品种。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第六条&nbsp;&nbsp;&nbsp; 严禁携带烟花爆竹乘坐公共汽车（船）、轨道交通等公共交通工具。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第七条&nbsp;&nbsp;&nbsp; 违反本规定的，由公安、安全生产监督、城管执法、工商行政、交通运输管理等部门依法予以处理或者处罚。在禁止燃放烟花爆竹的时间、地点燃放烟花爆竹，或者以危害公共安全和人身、财产安全的方式燃放烟花爆竹的，由公安部门责令停止燃放，并处100元以上500元以下的罚款；构成违反治安管理行为的，依法给予治安管理处罚。造成财产损失或者人身伤害的，依法承担相应的法律责任。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第八条&nbsp;&nbsp;&nbsp; 任何单位及个人有权劝阻和向各级人民政府及其有关职能部门举报违法销售、储存、燃放烟花爆竹的行为。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第九条&nbsp;&nbsp;&nbsp; 本规定自2016年2月1日起施行。</span></p><p><span style=\"font-size:18px\">黄冈市人民政府<br/>2016年1月9日<br/></span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697729312,0),('11436a8a6bed63fcd676141eb43289a5','黄冈中学2015部门决算公开报表和年度决算说明',2,'<p><span style=\"font-size:18px\">&nbsp; 一、部门（单位）情况</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; （一）基本情况</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 湖北省黄冈中学简称“黄高”，前身是1904年创办的黄州府中学堂， 1949年6月，正式改名为“黄冈中学”。1953年被湖北省政府首批确定为省重点中学，1993年被湖北省政府首批认定为省级示范学校。一百多年来，黄冈中学为国家培养了一大批人才。从这里走出了前国家代主席董必武，著名文艺理论家胡风，中科院院士、国家自然科学一等奖获得者舒德干，嫦娥工程运载火箭系统总设计师贺祖明，音乐家王原平，在亚运会上一举夺得4枚金牌的体育健将邱波等一大批优秀人才。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学新校园占地面积500亩，建筑面积15万平方米，校园规划合理，功能完善，设施齐全，环境幽雅。学校图书馆拥有文史哲阅览室1个、语文期刊阅览室2个、英语期刊阅览室1个、综合阅览室3个，研修室3个，藏书30万册，期刊15万册，电子阅览室配有计算机92台。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 1．主要职责与目标:</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学秉承“弘德尚学，笃行致远”的校训，明确“培养有崇高理想、有社会责任感、 有奉献精神的时代精英和创新人才”的育人目标，致力于为学生的可持续发展奠基，全面促进学生健康成长，全面塑造学生人格，全面开发学生智能，全面提升学生综合素质。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 目前，黄冈中学正以改革创新为动力，以激发师生内动力为着力点，不断提高教育教学质量,努力提升办学水平，为建成全省示范、全国一流、有国际影响力的学校而努力奋斗。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 2．机构人员情况。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学和市直其他所有公办中小学一样，没有单独设立财务机构，学校的财务管理模式是总务处下设会计出纳岗位。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 学校内部机构设置分别为校办公室、校工会、总务处、教务处、教研处、奥赛中心、政教处、团委、学生寝室管理处、法制安全处、电教处、后勤服务中心等12个处室。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 学校定员定编383人，在职教职员工273人，离休2人，退休124人，临时工及招聘人员59人，经费开支人数458人。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 3．机构、编制、年末实有人数与财政供养人员的变动情况及原因：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 在职教职员工273人比去年265人增加8人，为新招收教师。退休124人比去年130人减少6人，为退休人员自然减员死亡人数。经费开支人数458人与去年相同不变。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; （二）当年取得的主要事业成效</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 概述部门（单位）工作开展情况及主要事业成效。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 2015年我校的教学目标与任务是响应市委市政府的要求，推进教育教学改革创新，全面推行素质教育，控制招生规模、实行小班教学，在高一高二年级试行管乐、美术、书法、汽车驾驶与保养、陶艺、厨艺、动漫与微电影制作等选课走班教学模式。做到加强素质教育与提高高考成绩、奥赛成绩同时抓。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 二、部门决算公开报表（详见附件2015年《决算批复公开表》）</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 三、 “三公”经费增减变化原因等说明信息：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 我校较去年三公经费有较大幅度的减少，为学校节约了不少的开支，这得益于 “八项规定”政策执行的好。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 因公出国（境）团组数4批次，17人，费用120,910.50元（含14名师生参加菲律宾文化交流活动以及英语教师出国学习费用）。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 国内公务接待费开支112,315.00元。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 公务用车配备情况：鄂J00828小车一辆、鄂J0D052商务车一辆共两辆,公务用车运行费132,171.44元。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 附件：</span><a title=\"2015年决算批复公开表\" href=\"http://www.hbshgzx.com/Article/UploadFiles/201610/2016102617265577.rar\" style=\"text-decoration: none; color: rgb(51, 51, 51);\"><span style=\"color:#0000ff;font-size:18px\">2015年决算批复公开表</span></a></p><p><span style=\"font-size:18px\">湖北省黄冈中学<br/>2016-10-19</span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697522052,0),('135281a1aadfcf22564651b261b449c9','“共享单车•文明骑行”倡议书',2,'<p><span style=\"font-size:18px\">全校各位教职工、各位同学：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 最近，黄冈市区大街小巷流动着共享单车的亮丽风景线。共享单车作为共享经济的新兴事物，<strong>便捷、绿色、环保</strong>，方便了我们的日常出行，受到越来越多的人喜爱。但是在享受便利低碳出行的同时，一些乱停乱放、恶意损坏等不文明现象，不仅扰乱了城市交通秩序，抹黑了城市形象，也危及每个人的<strong>出行安全</strong>。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为进一步倡导<strong>低碳、环保、健康</strong>的出行方式，进一步提升城市文明形象，让我们在共享单车的便捷时，也要<strong>共享安全、文明</strong>，我校特此向全体师生发出如下倡议：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 一、<strong>文明骑行</strong>。遵守交通法规，不上高速（高架）路、不闯红灯、不逆行、不在机动车道骑行、不追逐打闹，文明礼让行人，坚决摒弃各种不良行为。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 二、<strong>文明停放</strong>。骑行结束后应按照规定将共享单车停放在指定的停车线内，或者在停车棚内、道路两旁有序停放，不乱停乱放，不占用盲道、绿地、消防通道等公共区域，不将共享单车停放在封闭式小区、办公楼、停车场、车库等封闭区域。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 三、<strong>爱护车辆</strong>。遵守社会公德，爱护单车，不乱贴乱画、不恶意损坏，不把共享单车私自上锁，不私藏、不据为己有。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 四、<strong>监督举报不文明使用共享单车行为</strong>。积极宣传文明骑行、有序停放的重要意义，提醒人们爱护公共设施，见到乱停放的共享单车自觉扶起并停放好，及时劝阻、制止破坏共享单车的不良行为，并大胆举报故意破坏行为。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>另外：</strong>由于共享单车是社会公共资源，不应私自停放在校园内部；共享单车容易随意停放，会影响校园教学和生活秩序，造成安全隐患。根据市校车办规定，从9月1号起禁止摩拜单车等共享单车进入校园存放。<strong>我校将严格禁止共享单车进入校园。</strong></span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 共享单车折射文明之光，<strong>共享单车，更应共享文明。</strong>让我们携起手来，<strong>以点滴力量助力城市秩序，用社会合力促进城市的文明与进步。</strong>让我们每个人从我做起，从现在做起，自觉遵守交通规则，文明使用共享单车，同心共铸文明城市，<strong>让“骑行”更美、更安全！</strong></span></p><p><span style=\"font-size:18px\">黄冈中学政教处<br/>2017年10月23日<br/></span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697285779,0),('1ab6b0abd3a9f76d6a47d16d6ade95e4','固定好地方的官方',1,'<p>地负海涵或或或或或或或或或或或或或或或或或或或或或或或或或</p>',NULL,NULL,'d39c1193bae006259fa2c7e762c94233',1501578739340,0),('23be742bbb14efcc076918213b27def4','校园通知校园通知校园通知校园通知校园通知',2,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>提供、处理、维护、改善、开发我们的商品和/或提供给您的服务，包括售后服务和客户支持，以及通过设备或网站提供的服务</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>允许您在公共论坛上发表评论。</p></li><li><p>进行促销活动，例如抽奖或Facebook 活动。</p></li><li><p>分析和开发与我们产品及服务的使用相关的统计信息，以更好地改进我们的产品和服务。</p></li><li><p>储存并维护与您相关的信息，用于我们运营业务或履行法律义务</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">关于我们如何使用您的信息（其中可能包含个人信息），下面提供了更多详细信息-</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li></ul><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1506494336994,0),('2750a7cf1bfbca1f16b6def0f4725f77','一班和七班的公告',1,'<h2 style=\"border-bottom-color:#cccccc;border-bottom-width:2px;border-bottom-style:solid;padding:0px 4px 0px 0px;margin:0px 0px 10px;text-align:center;\" class=\"ue_t\"><span style=\"color: rgb(255, 0, 0);\">[键入文章标题]</span></h2><p><strong><span style=\"font-size:12px;\">摘要</span></strong><span style=\"font-size:12px;\" class=\"ue_t\">：这里可以输入很长很长很长很长很长很长很长很长很差的摘要</span></p><p style=\"line-height:1.5em;\"><strong>标题 1</strong></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">这里可以输入很多内容，可以图文混排，可以有列表等。</span></p><p style=\"line-height:1.5em;\"><strong>标题 2</strong></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">来个列表瞅瞅：</span></p><ol style=\"list-style-type: lower-alpha;\" class=\" list-paddingleft-2\"><li><p class=\"ue_t\">列表 1</p></li><li><p class=\"ue_t\">列表 2</p></li><ol style=\"list-style-type: lower-roman;\" class=\" list-paddingleft-2\"><li><p class=\"ue_t\">多级列表 1</p></li><li><p class=\"ue_t\">多级列表 2</p></li></ol><li><p class=\"ue_t\">列表 3<br/></p></li></ol><p style=\"line-height:1.5em;\"><strong>标题 3</strong></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">来个文字图文混排的</span></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">这里可以多行</span></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">右边是图片</span></p><p style=\"text-indent:2em;\"><span style=\"font-size:14px;\" class=\"ue_t\">绝对没有问题的，不信你也可以试试看</span></p><p><br/></p><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501493429184,0),('2d3fae027c970bb19fddfa4e6d88bcee','两个班级都能看到',2,'<p><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493060830,0),('2f50c72a5cf37d8d0d4bc9235ef25eec','开始的开始',1,'ccccc',NULL,NULL,'690',1499769163369,0),('39df88de8d92751d0c179f203017ea04','ffffff',2,'<p><img src=\"http://114.215.29.139:10005/platform/file/pic/show?picPath=/opt/platform/vfsroot/ueditor/20171101/1509517474529057841.png\" title=\"1509517474529057841.png\" alt=\"班级简介.png\"/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1509517479155,0),('43b95bc348de0d0a121fdbe8cf1a63fd','1',1,'<p>1</p>',NULL,NULL,'d39c1193bae006259fa2c7e762c94233',1501556244882,0),('44fb0f70a3d87257aa77912b5c56b03e','校园通知全校通知',2,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>和开发与我们产品及服务的使用相关的统计信息，以更好地改进我们的产品和服务。</p></li><li><p>储存并维护与您相关的信息，用于我们运营业务或履行法律义务</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">关于我们如何使用您的信息（其中可能包含个人信息），下面提供了更多详细信息-</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您参与 MIUI 论坛。与 MIUI 论坛或其他小米网络平台有关的个人信息可能被用于个人资料页面展示、与其他用户互动、参与论坛。</span></p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供小米云和其他 MIUI 服务</span>。收集信息（设备或 SIM 卡相关信息，包括 IMEI 号码、IMSI 号码、电话号码、设备号、设备操作系统、MAC 地址、设备类别、系统和性能信息和诸如移动国家代码、移动网络代码、位置区域代码和小区标识等位置信息）用于激活 MIUI 服务，例如小米云、通话日志同步、短消息同步、查找设备，并用于用户认证和服务激活。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">诊断激活失败</span>：相关的地理位置信息用于评估 SIM 卡激活失败（例如短信服务 (SMS) 网关和网络失效），以识别该服务的网络运营商，并向网络运营商通知这一问题。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供其他 MIUI 服务</span>。为每项 MIUI 服务收集的其他信息可能会用于执行该服务的功能，为了用户利益帮助提供该项服务，例如下载、更新、注册、执行与 MIUI 服务相关的活动。例如，通过主题商店收集的个人信息可能会用于根据您的下载和浏览历史提供个性化主题推荐服务。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供其他 MIUI 服务</span>。为每项 MIUI 服务收集的其他信息可能会用于执行该服务的功能，为了用户利益帮助提供该项服务，例如下载、更新、注册、执行与 MIUI 服务相关的活动。例如，通过主题商店收集的个人信息可能会用于根据您的下载和浏览历史提供个性化主题推荐服务。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">记录照片的位置信息</span>。您能够在拍照时记录位置信息。这一信息在照片文件夹中可见，并且位置将保存在照片的标头中。如果您不希望在拍照时记录位置，您可以随时在设备相机设置中关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供信息传送功能（例如米聊、Mi Message）</span>。如果您下载和使用米聊，米聊收集的信息可能会用于激活这一服务，并识别用户和信息接收者。此外，聊天记录将被保存，便于在用户重新安装应用后重新加载历史聊天，或用于设备之间的同步。信息（发送者和接收者的电话号码和 Mi Message 账号）可用于 Mi Message 服务激活，让该服务发挥作用，包括消息的路由选择。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供基于位置的服务</span>。在使用 MIUI 服务时，我们或第三方服务供应商可能会使用位置信息以为您提供正确版本的服务，并且提供准确的位置，以获得尽可能好的用户体验，例如天气信息、位置接入（作为安卓平台的一部分）。您可以随时进入设备设置或停止使用这一应用程序来关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">改善用户体验</span>。某些选择性加入功能，例如用户体验计划，允许小米分析用户如何使用手机和 MIUI 服务的数据，以改善用户体验，例如发送崩溃报告。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您使用安全中心</span>。收集的信息可能会用于安全中心的安全和系统维护功能，例如广告拦截、病毒扫描、省电模式、黑名单、清理器等。其中有些功能是由第三方服务供应商运营的。信息（像病毒定义列表之类的非个人信息）将用于病毒扫描功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供推送服务</span>。小米账号和 IMEI 号码也将用于提供小米推送服务，以评估广告表现和从 MIUI 发送软件更新或新产品发布的通知，包括销售和促销信息。您可以随时通过更改“设置”项下的偏好选项来关闭这一功能。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">验证用户身份</span>。小米使用 ECV 值来验证用户身份，确保黑客或未经授权的人员无法登陆。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">收集用户反馈</span>。您选择提供的反馈对帮助小米改进我们的服务而言极为珍贵。为了跟踪您选择提供的反馈，小米可能会使用您所提供的个人信息与您联系，并保留记录。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">发送通知</span>。我们可能会不时使用您的个人信息来发送重要通知，例如有关购买物的通信和我们的条款、条件和政策变更。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">进行促销活动</span>。如果您通过小米的 Facebook 页面或其他社交媒体平台参与了抽奖、比赛或类似的促销，我们可能会使用您提供的个人信息来管理这些项目。</p></li></ul><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px; font-family: Arial, seri-sans; font-size: 14px; white-space: normal;\">直接推广</h4><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>我们可能会使用您的姓名、电话号码、电子邮箱地址、小米账号、IMEI 号码向您提供小米公司及其合作伙伴（提供网络、移动应用程序和云产品和服务）的产品和服务相关的推广资料。为了提供更好的用户体验，我们会根据您的购买历史、网站浏览历史、生日、年龄、性别和地理位置等信息推荐上述产品、服务和活动。我们严格遵守您所在地的数据保护法，要求独立的明确许可，所以我们只会在征得您的同意或您表示不反对时使用您的个人信息。您有权终止我们使用计划用于直接推广的个人数据。如果您不再希望接收某些类别的电子邮件，您可以通过每封邮件底部的取消订阅链接来取消订阅。我们不会将您的个人信息传送给我们的商业伙伴以便用于直接推广。</p></li></ul><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px; font-family: Arial, seri-sans; font-size: 14px; white-space: normal;\">Cookie 和其他技术（只在浏览 www.mi.com 时）</h4><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">收集哪些信息以及如何使用这些信息</span>？小米和第三方服务供应商使用 cookie、标签和脚本等技术。这些技术用于分析趋势、管理网站、追踪用户的网站活动并收集关于整个用户群的人口统计信息。我们会收到这些公司基于使用上述技术的单独和汇总报告。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">日志文件</span>：和大部分网站一样，我们收集特定信息并保存在日志文件中。此类信息可能包括互联网协议 (IP) 地址、浏览器类型、互联网服务供应商 (ISP)、引用/退出页面、操作系统、日期/时间戳和点击流数据。 我们不会将自动收集的数据链接到我们收集的关于您的其他信息之中。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">广告</span>：我们与第三方服务供应商合作，在我们的网站上展示广告或管理我们在其他网站上的广告。我们的第三方服务供应商可能会使用诸如 cookie 等技术来收集您在其网站或其他网站上的活动信息，以根据您的浏览活动和兴趣为您提供广告。如果不希望该信息被用于根据您的兴趣投放广告，可以点击此处（http://preferences-mgr.truste.com）选择退出。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">移动分析</span>：在某些移动应用中，我们使用移动分析软件，以更好地了解我们的移动软件在您的手机中的功能。此款软件可能记录以下信息，如您使用该应用程序的频率、该应用程序内发生的事件、累计使用、性能数据及应用程序崩溃发生的位置。我们不会将存储于分析软件内的信息链接到您在移动应用程序中提交的任何个人信息。</p></li></ul><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1506494413033,0),('4a50f1658603a55730fbc8d515398901','66666',1,'666666',NULL,NULL,'690',1499332747700,0),('5179a1af032742fe39b123cdf77d837f','3243。与电子商务订单相关的信息可用于处理订购单和相关的售',2,'<p>啊速度发的说法</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您参与 MIUI 论坛。与 MIUI 论坛或其他小米网络平台有关的个人信息可能被用于个人资料页面展示、与其他用户互动、参与论坛。</span></p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供小米云和其他 MIUI 服务</span>。收集信息（设备或 SIM 卡相关信息，包括 IMEI 号码、IMSI 号码、电话号码、设备号、设备操作系统、MAC 地址、设备类别、系统和性能信息和诸如移动国家代码、移动网络代码、位置区域代码和小区标识等位置信息）用于激活 MIUI 服务，例如小米云、通话日志同步、短消息同步、查找设备，并用于用户认证和服务激活。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">诊断激活失败</span>：相关的地理位置信息用于评估 SIM 卡激活失败（例如短信服务 (SMS) 网关和网络失效），以识别该服务的网络运营商，并向网络</p></li></ul><p><br/></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493141919,0),('5907220df60585eaa32b8a909f8fd233','图片',2,'<p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">各位校友：</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学创办于1904年，前身是1904年创办的黄州府中学堂， 1949年6月，正式改名为“黄冈中学”。1953年被湖北省政府首批确定为省重点中学，1993年被湖北省政府首批认定为省级示范学校。一百多年来，学校向高等院校和社会输送了10万余名毕业生，为国家培养了一大批人才。目前，有数以万计的毕业生分布在世界各地，在各自的岗位上为为国家和社会作出了突出的贡献。</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了加强校友与校友、校友与母校、各地校友分会与母校之间的沟通和交流，凝聚广大校友的力量和智慧，为母校“二次创业”建言献策，学校成立了黄冈中学校友总会校友联络处。主要工作职责如下：</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 1、负责各班各届校友回访母校的参观和接待工作；<br/>&nbsp;&nbsp;&nbsp; 2、负责参加各地校友分会的聚会或年会活动；<br/>&nbsp;&nbsp;&nbsp; 3、负责“黄高论坛”之校友论坛项目的策划和宣讲活动；<br/>&nbsp;&nbsp;&nbsp; 4、负责大型校庆活动的联络；<br/>&nbsp;&nbsp;&nbsp; 5、负责接受校友的捐赠和黄冈中学教育发展基金会的日常活动。</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 亲爱的校友，无论你人在哪里，母校总是在关注你；无论你走多远，母校总是会和你的心连在一起。热忱欢迎你们回母校看看，共叙母校情、师生情、同学情。请把你和你们的情况告知母校，请把你熟知校友的信息告诉我们。母校感谢你的支持！</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了方便广大校友与学校取得联系，联系方式如下：<br/>&nbsp;&nbsp;&nbsp; 1、<strong>学校办公室电话</strong>：0713-8838888;<br/>&nbsp;&nbsp;&nbsp; 2、<strong>校友会联络人</strong>：<br/>&nbsp;&nbsp;&nbsp; 赵&nbsp;&nbsp; 峰老师（电话13409715308）<br/>&nbsp;&nbsp;&nbsp; 戴&nbsp;&nbsp; 军老师（电话13476597286）<br/>&nbsp;&nbsp;&nbsp; 罗&nbsp;&nbsp; 凯老师（电话15971390686）<br/>&nbsp;&nbsp;&nbsp; 王建文老师（电话13971704757）<br/>&nbsp;&nbsp;&nbsp; 3、<strong>校友微信公众号</strong>：黄高人之家<br/>&nbsp;&nbsp;&nbsp; 4、<strong>黄冈中学网站</strong>：</span><a href=\"http://www.hbshgzx.com/\" style=\"text-decoration-line: none; color: rgb(51, 51, 51);\"><span style=\"font-size:18px\">www.hbshgzx.com</span></a><span style=\"font-size:18px\">，<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>黄冈中学微信公众号</strong>：hbshgzx（在微信中搜索公众号后，可添加关注，公众号二维码见下 ）</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\"><img src=\"/ueditor/jsp/upload/image/20170803/1501748104582075922.jpg\" width=\"258\" height=\"258\"/></span></p><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501748105974,0),('597c95423a725867751c201812dd69b6','校园通知通知',2,'<p>校园通知通知校园通知通知校园通知通知校园通知通知校园通知通知校园通知通知校园通知通知</p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493072152,0),('5bd2ddef5e6001790273e9294af6fd85','五年一班123的校园通知',2,'<p><span class=\"school-type\" style=\"color: rgb(82, 82, 82); font-family: &quot;Microsoft YaHei&quot;; font-size: 13.3333px;\">五年一班123</span></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493047602,0),('60fb0fb6f18e66559f6fc00379244473','我的班牌1公告测试',1,'sssss',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501225978626,0),('617ff1e5ecb4eaab00c67a3cace47240','6666',2,'6666',NULL,NULL,'690',1499247294302,0),('63da0507a89beaf0b8a98922386bd698','或发送的消息、反馈以及您提供给我们的任何其他信息。',2,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>包括您的联系方式）：我们可能收集您提供给我们的任一或所有个人信息，例如姓名、手机号码、电子邮箱地址、送货地址、小米账号信息（例如您的安全相关信息、姓名、生日、性别）、订单、发票信息、您通过小米云或其他应用（例如相册、联系人列表）等同步的资料或数据、与创建账户、参与 MIUI 论坛或其他小米平台相关的信息，您添加的联系人号码或发送的消息、反馈以及您提供给我们的任何其他信息。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">设备或 SIM 卡相关信息</span>：与您的设备相关的信息。例如 IMEI 编号、IMSI 编号、MAC 地址、MIUI 版本、安卓版本、设备制造商信息和型号名称和网络运营商。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">我们指定的与您相关的信息</span>：我们可能收集并使用诸如小米账号等信息。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">位置信息（仅适用于特定服务/功能）</span>：与您的位置相关的各类信息。例如国家代码、城市代码、移动网络代码、小区标识、经纬度信息和语言设置。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">登录信息</span>：与您使用某些功能、应用和网站相关的信息。例如 cookie 和其他匿名标识符技术、IP 地址、临时消息历史和标准系统日志等。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">其他信息</span>：环境特征值 (ECV)（即从小米账号、电话设备账号、连接的 wi-fi 账号和地理位置信息）</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">我们还可能收集其他各类与个人没有关联的匿名信息。例如，在使用特定服务时，可能收集用户的小米手机的设备型号和系统版本号。收集此类信息的目的在于改善我们向您提供的服务。所收集信息的类别和数量取决于您如何使用、加入或参与我们产品和/或服务。</p><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px; font-family: Arial, seri-sans; font-size: 14px; white-space: normal;\">这些个人信息将会被如何使用</h4><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">收集个人信息的目的在于向您提供产品和/或服务，并且保证我们遵守适用法律。您特此同意我们出于本隐私政策规定的目的处理个人信息，并向我们的关联公司（其涉及通信、社交媒体、技术和云业务）、第三方服务供应商（定义如下）披露个人信息。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">我们可能会将您的个人信息用于下列目的：</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>提供、处理、维护、改善、开发我们的商品和/或提供给您的服务，包括售后服务和客户支持，以及通过设备或网站提供的服务</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>允许您在公共论坛上发表评论。</p></li><li><p>进行促销活动，例如抽奖或Facebook 活动。</p></li><li><p>分析和开发与我们产品及服务的使用相关的统计信息，以更好地改进我们的产品和服务。</p></li><li><p>储存并维护与您相关的信息，用于我们运营业务或履行法律义务</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">关于我们如何使用您的信息（其中可能包含个人信息），下面提供了更多详细信息-</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li></ul><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1506494447518,0),('703159d7faf419b065331cf680dbba97','通知标题通知标题通知标题通知标题通知标题通知标题通知标题通知标题',2,'<p><span style=\"background-color: rgb(255, 255, 255); color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt; font-weight: bold; line-height: 26px;\">各院、系，全校师生：</span><span style=\"color: rgb(34, 34, 34); font-family: 宋体, Arial; font-size: 14px; background-color: rgb(255, 255, 255);\"><p style=\"margin: 0pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">2017年7月26日，习近平总书记在省部级主要领导干部“学习习近平总书记重要讲话精神，迎接党的十九大”专题研讨班上发表了重要讲话。讲话为党的十九大胜利召开奠定了重要的政治、思想和理论基础。深入学习贯彻习近平总书记这一重要讲话精神，是当前和今后一个时期的重大政治任务。现将有关要求通知如下。</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 28.15pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt; font-weight: bold;\">1、充分认识、深刻把握习近平总书记重要讲话精神的重大意义和精神实质</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">在党的十九大召开前夕，党中央举办省部级主要领导干部专题研讨班，对于进一步增强“四个意识”、统一全党思想、凝聚全党意志，为即将召开的党的十九大做好思想准备、政治准备、理论准备，具有重大而深远的意义。各级党组织和广大党员干部要以高度的政治责任感和历史使命感，不断深化对讲话重大政治意义、理论意义、实践意义的理解，把思想认识行动高度统一到习近平总书记的重要讲话精神上来，高度统一到中央的决策部署上来。</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">习近平总书记的重要讲话，高屋建瓴、思想深刻、内涵丰富，提出了一系列新的重要思想、重要观点、重大判断、重大举措，要在深刻认识和准确把握丰富内涵、精神实质、基本要求上下功夫，自觉用讲话精神武装头脑、指导实践、推动工作。一是深刻认识和把握中国特色社会主义是改革开放以来党的全部理论和实践的主题。二是深刻认识和把握党的十八大以来党和国家事业发生的历史性变革。三是深刻认识和把握我国社会发展的阶段性特征。四是深刻认识和把握中国特色社会主义进入新的发展阶段。</span><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">五是深刻认识和把握坚持和发展中国特色社会主义必须高度重视理论建设和理论指导。六是深刻认识和把握“两个一百年”奋斗目标的战略部署。七是深刻认识和把握坚定不移推进全面从严治党的新认识新要求。</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 28.15pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt; font-weight: bold;\">2、多种形式，切实加强对习近平总书记重要讲话精神的学习贯彻</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">校内各级党组织和全校师生要把学习贯彻习近平总书记在专题研讨班上的重要讲话精神作为当前重要的政治任务，结合“ 两学一做”学习教育活动，加大舆论宣传力度，全面展开、全力推进，为党的十九大胜利召开营造团结奋进的浓厚氛围。编印专题《学习文选》、校园网、官方微信及时发布相关内容。采用自学与集中学习相结合的方式，暑期以党员干部和教职工自学为主，学习内容可参照校园网“热点推荐”的学习内容。 9月开学后，各党总支、直属党支部通过组织生活、政治学习、座谈会等方式积极组织广大师生开展学习和讨论；校党委中心组、党总支（直属党支部）、支部要把深入学习习近平总书记重要讲话精神作为九月份政治学习的重要内容，结合学校实际，组织集中学习，认真开展座谈、交流讨论。切实把思想和行动统一到习近平总书记重要讲话精神上来，牢记“四个意识”，自觉在思想上政治上行动上同以习近平同志为核心的党中央保持高度一致，维护核心、维护权威，切实做到政治思想上落实、学习上落实、工作上落实，以实际行动迎接党的十九大胜利召开。</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">&nbsp;</span></p><p style=\"margin: 0pt -17pt 0pt 7.05pt; padding: 0px; text-indent: 26pt; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">附：成都体育学院《学习文选》2017年第三期——学习习近平在省部级主要领导干部专题研讨班重要讲话精神专题</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 0em; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: justify;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">&nbsp;</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 0em; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: right;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 中共成都体育学院委员会</span></p><p style=\"margin: 0pt; padding: 0px; text-indent: 0em; font-stretch: normal; font-size: 13pt; line-height: 26px; font-family: 宋体; color: rgb(0, 0, 0); text-align: right;\"><span style=\"color: rgb(75, 75, 75); font-family: &quot;Times New Roman&quot;; font-size: 13pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年7月31日</span></p></span></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501576921515,0),('78afea32f1add5779dbf3cc7d78f396a','黄冈市中心城区全面禁止燃放烟花爆竹的规定',2,'<p><span style=\"font-size:18px\">第一条&nbsp;&nbsp;&nbsp; 为加强烟花爆竹安全管理，保障公共安全和减少环境污染，根据《烟花爆竹安全管理条例》（国务院令第455号）、《湖北省燃放烟花爆竹若干规定》（省政府令第289号）有关规定、借鉴外地经验，制定本规定。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第二条&nbsp;&nbsp;&nbsp; 黄冈中心城区下列区域内全年禁止燃放烟花爆竹：东起南湖路与世纪大道交汇处，沿世纪大道南端，南至沿江大道，西以沿江大道为界，西北至新港北路与沿江大道交汇处，北沿新港北路，至黄婆汉路与三台河交汇处，沿三台河西岸，东至三台河与南湖路交汇处的围合范围。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第三条&nbsp;&nbsp;&nbsp; 未列入禁止燃放烟花爆竹的区域，禁止在下列地点燃放烟花爆竹：<br/>&nbsp;&nbsp;&nbsp; （一）党政机关所在地；<br/>&nbsp;&nbsp;&nbsp; （二）文物保护单位；<br/>&nbsp;&nbsp;&nbsp; （三）车站、码头等交通枢纽以及铁路线路安全保护区及其他重点消防单位或区域；<br/>&nbsp;&nbsp;&nbsp; （四）重要军事设施和输变电设施安全保护区；<br/>&nbsp;&nbsp;&nbsp; （五）易燃易爆物品生产、储存单位、场所；<br/>&nbsp;&nbsp;&nbsp; （六）幼儿园、托儿所、医院、敬老院、疗养院、教学、科研、生产等场所；<br/>&nbsp;&nbsp;&nbsp; （七）山林等重点防火区；<br/>&nbsp;&nbsp;&nbsp; 黄州区人民政府、黄冈高新区管委会、市区有关职能部门，应当在上述地点设置警示标志，明确守护责任单位和责任人，制订应急预案，加强禁止燃放烟花爆竹的管理。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第四条&nbsp;&nbsp;&nbsp; 禁鞭区域内烟花爆竹的生产、储存、运输、销售、使用和处置，按照相关法律、法规、规章执行。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第五条&nbsp;&nbsp;&nbsp; 未列入禁止燃放烟花爆竹的区域，未经许可不得经营、运输烟花爆竹；销售、储存、燃放的烟花爆竹应当符合安全生产监督、公安、工商行政管理等部门规定的规格和品种。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第六条&nbsp;&nbsp;&nbsp; 严禁携带烟花爆竹乘坐公共汽车（船）、轨道交通等公共交通工具。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第七条&nbsp;&nbsp;&nbsp; 违反本规定的，由公安、安全生产监督、城管执法、工商行政、交通运输管理等部门依法予以处理或者处罚。在禁止燃放烟花爆竹的时间、地点燃放烟花爆竹，或者以危害公共安全和人身、财产安全的方式燃放烟花爆竹的，由公安部门责令停止燃放，并处100元以上500元以下的罚款；构成违反治安管理行为的，依法给予治安管理处罚。造成财产损失或者人身伤害的，依法承担相应的法律责任。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第八条&nbsp;&nbsp;&nbsp; 任何单位及个人有权劝阻和向各级人民政府及其有关职能部门举报违法销售、储存、燃放烟花爆竹的行为。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 第九条&nbsp;&nbsp;&nbsp; 本规定自2016年2月1日起施行。</span></p><p><span style=\"font-size:18px\">黄冈市人民政府<br/>2016年1月9日<br/></span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697694508,0),('809cc9e2c20fbe01d62339597d6ac81f','《青云吟草》征稿启事',2,'<p><span style=\"font-size:18px\">黄冈中学“青云诗社” 成立于2004年，其专刊《青云吟草》第三期已于2016年9月与广大教职工见面。为进一步弘扬正能量，提升学校文化品味，扩大学校的社会影响，诗社正在组织出版第四期。现面向教职工、在校学生和广大校友征集稿件，要求如下：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;1．作品内容：符合社会主旋律，体现社会主义核心价值观，具有昂扬向上的正能量。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 2．作品体裁：传统诗、词。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 3．本期截稿时间：2017年5月31日。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 4．投稿方式：纸质稿件和电子稿件均可。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 5．投稿要求：作品以真实姓名投稿，并注明联系方式及联系电话、邮编、住址等。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 6．投稿地址：<br/>&nbsp;&nbsp;&nbsp; ①.电子文档请发至</span><a href=\"mailto:970314482@qq.com\" style=\"text-decoration: none; color: rgb(51, 51, 51);\"><span style=\"font-size:18px\">970314482@qq.com</span></a><span style=\"font-size:18px\">邮箱。<br/>&nbsp;&nbsp;&nbsp; ②.纸质文稿请用规范汉语简体字书写，来稿请寄：湖北省黄冈市黄州区黄冈中学老校区（今启黄中学）办公楼一楼右侧《青云吟草》编辑部（邮编：438000）</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 联系人：祁春山老师（15971399039）<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:18px\">戴&nbsp;&nbsp; 军老师（13476597286）<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 来秋元老师（15807258295）<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 王建文老师（13971704757）</span></p><p><span style=\"font-size:18px\">《青云吟草》编辑部<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2017年2月13日&nbsp;&nbsp;</span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697326178,0),('876aa6425a2397a3e57a93ed80950b91','黄冈中学关于加强各届校友联络的公告',2,'<p><span style=\"font-size:18px\">各位校友：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学创办于1904年，前身是1904年创办的黄州府中学堂， 1949年6月，正式改名为“黄冈中学”。1953年被湖北省政府首批确定为省重点中学，1993年被湖北省政府首批认定为省级示范学校。一百多年来，学校向高等院校和社会输送了10万余名毕业生，为国家培养了一大批人才。目前，有数以万计的毕业生分布在世界各地，在各自的岗位上为为国家和社会作出了突出的贡献。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了加强校友与校友、校友与母校、各地校友分会与母校之间的沟通和交流，凝聚广大校友的力量和智慧，为母校“二次创业”建言献策，学校成立了黄冈中学校友总会校友联络处。主要工作职责如下：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 1、负责各班各届校友回访母校的参观和接待工作；<br/>&nbsp;&nbsp;&nbsp; 2、负责参加各地校友分会的聚会或年会活动；<br/>&nbsp;&nbsp;&nbsp; 3、负责“黄高论坛”之校友论坛项目的策划和宣讲活动；<br/>&nbsp;&nbsp;&nbsp; 4、负责大型校庆活动的联络；<br/>&nbsp;&nbsp;&nbsp; 5、负责接受校友的捐赠和黄冈中学教育发展基金会的日常活动。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 亲爱的校友，无论你人在哪里，母校总是在关注你；无论你走多远，母校总是会和你的心连在一起。热忱欢迎你们回母校看看，共叙母校情、师生情、同学情。请把你和你们的情况告知母校，请把你熟知校友的信息告诉我们。母校感谢你的支持！</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了方便广大校友与学校取得联系，联系方式如下：<br/>&nbsp;&nbsp;&nbsp; 1、<strong>学校办公室电话</strong>：0713-8838888;<br/>&nbsp;&nbsp;&nbsp; 2、<strong>校友会联络人</strong>：<br/>&nbsp;&nbsp;&nbsp; 赵&nbsp;&nbsp; 峰老师（电话13409715308）<br/>&nbsp;&nbsp;&nbsp; 戴&nbsp;&nbsp; 军老师（电话13476597286）<br/>&nbsp;&nbsp;&nbsp; 罗&nbsp;&nbsp; 凯老师（电话15971390686）<br/>&nbsp;&nbsp;&nbsp; 王建文老师（电话13971704757）<br/>&nbsp;&nbsp;&nbsp; 3、<strong>校友微信公众号</strong>：黄高人之家<br/>&nbsp;&nbsp;&nbsp; 4、<strong>黄冈中学网站</strong>：</span><a href=\"http://www.hbshgzx.com/\" style=\"text-decoration: none; color: rgb(51, 51, 51);\"><span style=\"font-size:18px\">www.hbshgzx.com</span></a><span style=\"font-size:18px\">，<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>黄冈中学微信公众号</strong>：hbshgzx（在微信中搜索公众号后，可添加关注，公众号二维码见下 ）</span></p><p><span style=\"font-size:18px\"><img src=\"http://www.hbshgzx.com/Article/UploadFiles/201312/2013121911340558.jpg\" width=\"258\" height=\"258\"/></span></p><p><span style=\"font-size:18px\">湖北省黄冈中学<br/>2017年3月28日<br/></span></