lign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td></tr><tr><td valign=\"top\" width=\"0\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td><td width=\"43\" valign=\"top\"><br/></td></tr></tbody></table><p><br/></p>',NULL,NULL,'ce862d1038593e7dadf34a5271dfa413',1501497239236,0),('8f725a00aecdf4fb103166dfc2c09978','44',2,'44',NULL,NULL,'690',1499390808946,0),('8fae5564776f65a5a21ea2a57574770a','是打发速度发的说法',2,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您参与 MIUI 论坛。与 MIUI 论坛或其他小米网络平台有关的个人信息可能被用于个人资料页面展示、与其他用户互动、参与论坛。</span></p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供小米云和其他 MIUI 服务</span>。收集信息（设备或 SIM 卡相关信息，包括 IMEI 号码、IMSI 号码、电话号码、设备号、设备操作系统、MAC 地址、设备类别、系统和性能信息和诸如移动国家代码、移动网络代码、位置区域代码和小区标识等位置信息）用于激活 MIUI 服务，例如小米云、通话日志同步、短消息同步、查找设备，并用于用户认证和服务激活。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">诊断激活失败</span>：相关的地理位置信息用于评估 SIM 卡激活失败（例如短信服务 (SMS) 网关和网络失效），以识别该服务的网络运营商，并向网络</p></li></ul><p><br/></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493115511,0),('90831f75fca286a82d5f066328fbd5e7','推广普通话 文明你我他',2,'<p><span style=\"font-size:18px\">全校教职工、各位同学：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 2017年9月11—17日，是第20届“全国推广普通话宣传周”（以下简称推普周），今年的推普主题是“大力推广和规范使用国家通用语言文字，自觉传承弘扬中华优秀传统文化”。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 雅言传承文明，经典浸润人生。作为中国人，我们每天都在抑扬顿挫的语音中享受汉语的魅力，在横平竖直的书法中得到书法艺术的熏陶。规范地使用普通话、写好汉字不仅可以提高全校师生的文明意识，美化校园育人环境，更可以维护母语的尊严，传承和弘扬中华优秀文化，培养我们的爱国之情。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 推广普通话，学校是前沿。在黄冈市全面创建全国文明城市的大背景下，推广普通话、构建文明校园显得更为重要。为此，学校特向全校师生发出以下倡议：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 1、师生以说普通话、写规范汉字为荣。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 2、教师上课、接待家长或与学生交谈时坚持使用普通话。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 3、学生坚持使用普通话与老师、同学交流，并能达到准确流利，养成说普通话的习惯。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 4、师生一同学习各种语言文字规范，确保我们的作业、试卷、教案、板书、班级板报等注音、用字和标点符号规范无误。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 5、请在家庭生活中尽量使用普通话，并且能积极带动家人说普通话，在力所能及的范围内主动推广普通话。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 6、请在社会生活中尽量坚持使用普通话，注意使用文明语，不说粗话和脏话，为城市形象的塑造、城市文明程度的提高尽一份力。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 7、对各种场合中的不规范语言、文字的使用要予以指正，开展查找错字、不规范字的社会实践活动，自觉做普通话的推广者和宣传员。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 8、将说好普通话和维护祖国语言健康纯洁结合起来，和爱国主义行动结合起来，使说普通话成为一种维护民族荣誉，崇尚祖国语言文化的自觉行动。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 作为一名公民，我们责无旁贷地要维护母语的纯洁和健康；作为黄高人，我们更要义不容辞地美化校园的语言环境。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 推广普通话、文明你我他。希望全体师生积极行动起来，积极投身第20届全国推广普通话宣传周活动，从自身开始、从现在开始、从课堂开始、从办公室开始、从校园开始，学普通话，说普通话，推广普通话。做到人人讲普通话，时时讲普通话，处处讲普通话。让我们为建设文明校园、构建和谐社会做出应有的贡献！</span></p><p><span style=\"font-size:18px\">湖北省黄冈中学<br/></span><span style=\"font-size:18px\">2017年9月9日<br/></span></p><p>文章录入：admin&nbsp;&nbsp;&nbsp;&nbsp;责任编辑：admin&nbsp;</p><p><br/></p>',NULL,NULL,'28e071403baae761a91282a477b27e12',1509697307528,0),('93c8df00e4921775fc6793d732c82cff','通知公告通知公告通知公告通知公告通知公告通知公告通知公告',2,'<p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">各位校友：</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 黄冈中学创办于1904年，前身是1904年创办的黄州府中学堂， 1949年6月，正式改名为“黄冈中学”。1953年被湖北省政府首批确定为省重点中学，1993年被湖北省政府首批认定为省级示范学校。一百多年来，学校向高等院校和社会输送了10万余名毕业生，为国家培养了一大批人才。目前，有数以万计的毕业生分布在世界各地，在各自的岗位上为为国家和社会作出了突出的贡献。</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了加强校友与校友、校友与母校、各地校友分会与母校之间的沟通和交流，凝聚广大校友的力量和智慧，为母校“二次创业”建言献策，学校成立了黄冈中学校友总会校友联络处。主要工作职责如下：</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 1、负责各班各届校友回访母校的参观和接待工作；<br/>&nbsp;&nbsp;&nbsp; 2、负责参加各地校友分会的聚会或年会活动；<br/>&nbsp;&nbsp;&nbsp; 3、负责“黄高论坛”之校友论坛项目的策划和宣讲活动；<br/>&nbsp;&nbsp;&nbsp; 4、负责大型校庆活动的联络；<br/>&nbsp;&nbsp;&nbsp; 5、负责接受校友的捐赠和黄冈中学教育发展基金会的日常活动。</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 亲爱的校友，无论你人在哪里，母校总是在关注你；无论你走多远，母校总是会和你的心连在一起。热忱欢迎你们回母校看看，共叙母校情、师生情、同学情。请把你和你们的情况告知母校，请把你熟知校友的信息告诉我们。母校感谢你的支持！</span></p><p style=\"font-family: Tahoma; font-size: 12px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 为了方便广大校友与学校取得联系，联系方式如下：<br/>&nbsp;&nbsp;&nbsp; 1、<strong>学校办公室电话</strong>：0713-8838888;<br/>&nbsp;&nbsp;&nbsp; 2、<strong>校友会联络人</strong>：<br/>&nbsp;&nbsp;&nbsp; 赵&nbsp;&nbsp; 峰老师（电话13409715308）<br/>&nbsp;&nbsp;&nbsp; 戴&nbsp;&nbsp; 军老师（电话13476597286）<br/>&nbsp;&nbsp;&nbsp; 罗&nbsp;&nbsp; 凯老师（电话15971390686）<br/>&nbsp;&nbsp;&nbsp; 王建文老师（电话13971704757）<br/>&nbsp;&nbsp;&nbsp; 3、<strong>校友