24ff77344c48f6a83261add','给回复和风格和的个返回',2,'<ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">允许您参与 MIUI 论坛。与 MIUI 论坛或其他小米网络平台有关的个人信息可能被用于个人资料页面展示、与其他用户互动、参与论坛。</span></p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">提供小米云和其他 MIUI 服务</span>。收集信息（设备或 SIM 卡相关信息，包括 IMEI 号码、IMSI 号码、电话号码、设备号、设备操作系统、MAC 地址、设备类别、系统和性能信息和诸如移动国家代码、移动网络代码、位置区域代码和小区标识等位置信息）用于激活 MIUI 服务，例如小米云、通话日志同步、短消息同步、查找设备，并用于用户认证和服务激活。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">诊断激活失败</span>：相关的地理位置信息用于评估 SIM 卡激活失败（例如短信服务 (SMS) 网关和网络失效），以识别该服务的网络运营商，并向网络</p></li></ul><p><br/></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506493106952,0),('a2e60df5826a774725d56339c16996b0','隐私政策隐私政策隐私政策隐私政策隐私政策隐私政策隐私政策隐私',1,'<h2 style=\"background-repeat: no-repeat; margin: 0px 0px 10px; padding: 0px;\">隐私政策</h2><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px;\">更新！</h4><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">我们的隐私政策已于<span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">2015 年 8 月 24 日</span>更新。我们对隐私政策进行了修订，从该日期开始，这一隐私政策能够提供有关我们如何管理您在使用所有小米产品和服务时透露的个人信息的隐私详情，除了特定的小米产品或服务提供独立的隐私政策以外。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">请花一些时间熟悉我们的隐私权惯例，如果您有任何问题，请告诉我们。</p><h3 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px;\">我们向您承诺</h3><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">本隐私政策规定了小米公司及关联公司（下文简称“小米”或“我们”）如何收集、使用、披露、处理和保护您在使用我们的产品和服务时通过<a href=\"http://www.mi.com/\" style=\"background-repeat: no-repeat; text-decoration: none;\">www.mi.com</a>、<a href=\"http://en.miui.com/\" style=\"background-repeat: no-repeat; text-decoration: none;\">en.miui.com</a>、<a href=\"https://account.xiaomi.com/\" style=\"background-repeat: no-repeat; text-decoration: none;\">account.xiaomi.com</a>、MIUI 以及我们在移动设备上提供的应用程序套装提供给我们的信息；有关这些应用程序的列表，请点击<a href=\"http://privacy-policy.truste.com/certified-policy/mobile/app/en/Xiaomi.com/validation_ZHS.html\" style=\"background-repeat: no-repeat; text-decoration: none;\">这里</a>。若我们要求您提供某些信息，以便在使用小米产品和服务时验证您的身份，我们将仅严格遵守本隐私政策和/或我们的用户条款与条件来使用这些信息。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">本隐私政策在制定时充分考虑到您的需求；您全面了解我们的个人资料收集和使用惯例而且确信自己最终能控制提供给小米的个人信息，这一点至关重要。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">在这项隐私政策中，“个人信息”指信息本身或与小米能够访问的个人的其他信息联系后能够识别特定个人的数据。此类个人信息包括您的姓名、地址、电话号码和电子邮箱地址。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">通过使用小米产品和服务，即表示您已阅读、认可并接受本隐私政策中所述之所有条款，包括我们随时作出的任何变更。我们承诺遵照适用法律（包括您所在地的数据保护法律）来保护您的个人信息的隐私、机密和安全。同时我们承诺我们的全体员工和代理商履行这些义务。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">最后，我们所希望的就是为我们的用户带来最好的体验。如果您对这一隐私政策中概括的数据处理惯例有任何疑问，请通过 privacy@xiaomi.com 联系我们的数据保护官，以便我们处理您的特殊需求。我们很高兴能直接处理您的问题。</p><h3 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px;\">收集哪些信息以及如何使用信息？</h3><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px;\">收集的信息类别</h4><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">为了向您提供我们的服务，我们会要求您提供向您提供服务所必需的个人信息。如果您不提供个人信息，我们可能无法向您提供我们的产品或服务。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">我们收集以下各类信息（无论其是否为个人信息）：</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; list-style-position: inside; list-style-image: initial;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">您提供给我们或上传的信息</span>（包括您的联系方式）：我们可能收集您提供给我们的任一或所有个人信息，例如姓名、手机号码、电子邮箱地址、送货地址、小米账号信息（例如您的安全相关信息、姓名、生日、性别）、订单、发票信息、您通过小米云或其他应用（例如相册、联系人列表）等同步的资料或数据、与创建账户、参与 MIUI 论坛或其他小米平台相关的信息，您添加的联系人号码或发送的消息、反馈以及您提供给我们的任何其他信息。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">设备或 SIM 卡相关信息</span>：与您的设备相关的信息。例如 IMEI 编号、IMSI 编号、MAC 地址、MIUI 版本、安卓版本、设备制造商信息和型号名称和网络运营商。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">我们指定的与您相关的信息</span>：我们可能收集并使用诸如小米账号等信息。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">位置信息（仅适用于特定服务/功能）</span>：与您的位置相关的各类信息。例如国家代码、城市代码、移动网络代码、小区标识、经纬度信息和语言设置。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">登录信息</span>：与您使用某些功能、应用和网站相关的信息。例如 cookie 和其他匿名标识符技术、IP 地址、临时消息历史和标准系统日志等。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">其他信息</span>：环境特征值 (ECV)（即从小米账号、电话设备账号、连接的 wi-fi 账号和地理位置信息）</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; line-height: 22px;\">我们还可能收集其他各类与个人没有关联的匿名信息。例如，在使用特定服务时，可能收集用户的小米手机的设备型号和系统版本号。收集此类信息的目的在于改善我们向您提供的服务。所收集信息的类别和数量取决于您如何使用、加入或参与我们产品和/或服务。</p><p><br/></p>',NULL,NULL,'0b18d3a044e46805e2bf0c26f1c82a3c',1506492906673,0),('ab9f3a70f20425729b0fed554d4b5f0c','６４５６４',2,'６４５６',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1500863070178,0),('b3652b75bbedb2422b36b8cf20