ue_t\">[这里可以键入您所掌握的技能]</span><br/></p><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501731194341,0),('dcd65d9da1403220266443ab56a517b3','是是是是是是是是是是好好好好好好好好好好看看看看看看看看看看了了了了了了了了了了哦哦哦哦哦哦哦哦哦哦',2,'<p>是是是</p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1501555207038,0),('e404450b536ca1f5cfe2a4cbc6013ca1','黄冈中学优秀高校校友回访母校公告',2,'<p><span style=\"font-size:18px\">校友回访和学习经验的分享是我校职业生涯规划课程的一部分，也是我校学生工作特色活动。高校校友学习经验丰富、视野开阔，对在校高中学生的学习、生活和成长等各方面有良好的指导作用，回访活动深得学生的欢迎。为进一步提高我校高校校友回访母校活动的质量和效果、促进活动规范化，特公告如下：</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>一、活动主题</strong></span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 回访母校，分享成长&nbsp;</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>二、活动时间及地点</strong></span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>（一）活动时间：</strong>&nbsp;<br/>&nbsp;&nbsp;&nbsp; 2017年1月15日下午15:10—17:10</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>（二）活动地点：<br/></strong>&nbsp;&nbsp;&nbsp; 凝晖楼东、西报告厅，佑铭楼各会议室、学生活动教室等。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>三、活动对象</strong></span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp; 高一、高二、高三学生，自愿参加。&nbsp;</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>四、活动流程</strong></span></p><p><span style=\"font-size:18px\"><strong>&nbsp;&nbsp;&nbsp; （一）活动前期</strong></span></p><p><span style=\"font-size:18px\"><strong>&nbsp;&nbsp;&nbsp;&nbsp; 1、预约回访<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 校友通过来校、电话等方式，在2017年1月7日前与学校取得联系，确定回访活动人数等需求，下载附件高校校友回访预约登记表，填好之后发至王惠老师QQ邮箱，</span><a href=\"mailto:854842245@qq.com\" style=\"text-decoration: none; color: rgb(51, 51, 51);\"><span style=\"font-size:18px\">854842245@qq.com</span></a><span style=\"font-size:18px\">.<br/>&nbsp;&nbsp;&nbsp;&nbsp; 联系人：政教处王惠老师&nbsp; 电话：15897910822</span></p><p><span style=\"font-size:18px\"><br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>2、提交资料<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 参加回访活动的资料要在2017年1月10日前发送至王惠老师邮箱：</span><a href=\"mailto:854842245@qq.com\" style=\"text-decoration: none; color: rgb(51, 51, 51);\"><span style=\"font-size:18px\">854842245@qq.com</span></a><span style=\"font-size:18px\">,资料通过学校审核方可宣讲或发放。资料包括：&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp; 回访母校活动的策划方案;<br/>&nbsp;&nbsp;&nbsp;&nbsp; 宣传材料;<br/>&nbsp;&nbsp;&nbsp;&nbsp; 宣讲会的发言稿、视频和PPT。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>3、会前集中<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 每个学校的宣讲会发言者需提前统一时间会前集中，准备充分方可宣讲（笔记本电脑、优盘等自备）。<br/>&nbsp;&nbsp;&nbsp;&nbsp; 集中时间：2017年1月15日下午13:00<br/>&nbsp;&nbsp;&nbsp;&nbsp; 集中地点：凝晖楼东报告厅</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>（二）活动进行<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 1、参加活动的校友14:30出发前往各宣讲地点，调试好电脑、音响等设备。<br/>&nbsp;&nbsp;&nbsp;&nbsp; 2、宣讲会15:10正式开始，要合理安排宣讲的流程和时间。2小时内，一般分为宣讲大学环节20分钟；讲解高中学习、生活等经验40分钟；提问互动交流60分钟。<br/>&nbsp;&nbsp;&nbsp;&nbsp; 3、把握宣讲重点。重要的是能够带给高中的学弟学妹们成长的启示，激发他们学习的内动力。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>（三）活动后期<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 1、负责场地卫生等善后工作&nbsp;<br/>&nbsp;&nbsp;&nbsp;&nbsp; 2、及时整理并归还借用物资<br/>&nbsp;&nbsp;&nbsp;&nbsp; 3、活动结束后优秀校友们可以合影留念<br/>&nbsp;&nbsp;&nbsp;&nbsp; 4、整理活动的照片、总结材料，并及时交给王惠老师</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;<strong>五、注意事项<br/></strong>&nbsp;&nbsp;&nbsp;&nbsp; 1、前期准备工作，预约回访、提交资料要及时；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 2、宣讲内容要提前做好充分准备，站在高中学弟学妹们的角度，思考高中生需要怎样的宣讲内容和启发；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 3、每个参加回访活动的大学要有一个负责人带队；<br/>&nbsp;&nbsp;&nbsp;&nbsp; 4、母校关心着每一位校友的发展，也请大家支持母校，爱母校，给她最好的帮助和回馈。</span></p><p><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>六、未尽事宜，另行通知。</strong></span></p><p><strong><span style=\"font-size:18px\">&nbsp;&nbsp;&nbsp;&nbsp; 附件：<a title=\"高校校友回访预约登记表\" href=\"http://www.hbshgzx.com/Article/UploadFiles/201612/2016121220573791.rar\" style=\"text-decoration: none; color: rgb(