" style=\"background-repeat: no-repeat; font-weight: 700;\">设备或 SIM 卡相关信息</span>：与您的设备相关的信息。例如 IMEI 编号、IMSI 编号、MAC 地址、MIUI 版本、安卓版本、设备制造商信息和型号名称和网络运营商。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">我们指定的与您相关的信息</span>：我们可能收集并使用诸如小米账号等信息。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">位置信息（仅适用于特定服务/功能）</span>：与您的位置相关的各类信息。例如国家代码、城市代码、移动网络代码、小区标识、经纬度信息和语言设置。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">登录信息</span>：与您使用某些功能、应用和网站相关的信息。例如 cookie 和其他匿名标识符技术、IP 地址、临时消息历史和标准系统日志等。</p></li><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">其他信息</span>：环境特征值 (ECV)（即从小米账号、电话设备账号、连接的 wi-fi 账号和地理位置信息）</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">我们还可能收集其他各类与个人没有关联的匿名信息。例如，在使用特定服务时，可能收集用户的小米手机的设备型号和系统版本号。收集此类信息的目的在于改善我们向您提供的服务。所收集信息的类别和数量取决于您如何使用、加入或参与我们产品和/或服务。</p><h4 style=\"background-repeat: no-repeat; margin: 0px; padding: 10px 0px; font-family: Arial, seri-sans; font-size: 14px; white-space: normal;\">这些个人信息将会被如何使用</h4><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">收集个人信息的目的在于向您提供产品和/或服务，并且保证我们遵守适用法律。您特此同意我们出于本隐私政策规定的目的处理个人信息，并向我们的关联公司（其涉及通信、社交媒体、技术和云业务）、第三方服务供应商（定义如下）披露个人信息。</p><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">我们可能会将您的个人信息用于下列目的：</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p>提供、处理、维护、改善、开发我们的商品和/或提供给您的服务，包括售后服务和客户支持，以及通过设备或网站提供的服务</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>与您就您的设备、服务或任何普通查询（例如更新、客户咨询支持、我们活动的相关信息、通知）等进行交流。</p></li><li><p>允许您在公共论坛上发表评论。</p></li><li><p>进行促销活动，例如抽奖或Facebook 活动。</p></li><li><p>分析和开发与我们产品及服务的使用相关的统计信息，以更好地改进我们的产品和服务。</p></li><li><p>储存并维护与您相关的信息，用于我们运营业务或履行法律义务</p></li></ul><p style=\"background-repeat: no-repeat; margin-top: 0px; margin-bottom: 10px; padding: 0px; font-family: Arial, seri-sans; line-height: 22px; font-size: 14px; white-space: normal;\">关于我们如何使用您的信息（其中可能包含个人信息），下面提供了更多详细信息-</p><ul style=\"background-repeat: no-repeat; padding: 0px 0px 5px 20px; font-family: Arial, seri-sans; list-style-position: inside; list-style-image: initial; font-size: 14px; white-space: normal;\" class=\" list-paddingleft-2\"><li><p><span class=\"bold\" style=\"background-repeat: no-repeat; font-weight: 700;\">创建您的小米账号。在通过网站或移动设备创建小米账号时收集的个人信息用于建立用户的个人小米账户和资料页。</span></p></li><li><p>处理您的订购单。与电子商务订单相关的信息可用于处理订购单和相关的售后服务，包括客户支持和重新发货。此外，订单号将用于交叉检查送货合作伙伴的订单和包裹的实际交付。收件人信息，包括姓名、地址、电话号码和邮政编码将用于送货。电子邮件地址用于向用户发送包裹跟踪信息。购买物品的清单用于打印发票，并允许客户确定包裹中的物品。</p></li></ul><p><br/></p>',NULL,NULL,'9cb61abee5ed73864f3b289b59198134',1506494428711,0);

